import React from "react";
import GaleriItem from "./components/GaleriItem";
import { Card, CardHeader, Container } from "@material-ui/core";

const Galeri = () => {
  return (
    <Card>
      <CardHeader title="Galery" subheader="Manage your galery" />
      <Container>
        <GaleriItem />
      </Container>
    </Card>
  );
};

export default Galeri;
